import React from "react";
import Login from "./Login";
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route } from "react-router";

class App extends React.Component {
  render () {
    return (
      <BrowserRouter>
        <Routes>
        <Login/>
        </Routes>
      </BrowserRouter>
    )
  }
}

export default App;
